        fetch('http://localhost:5001/api/v1/showBids/', {
            method: 'GET',
            headers: headers
        })
            .then((response) => response.json())
            .then((data) => {
                setPosts(data.products);
            })
            .catch((err) => {
                console.log(err.message);
            });
    }, []);

function App() {
